const Index = () => (
    <div className='outerdiv'>
        <div className='titlelogo'>
            slern.io
        </div>

        <style jsx>{`
        .outerdiv {
            background-color: #B0D3F3;
            width: 100%;
            height: 80px;
            display: block;
            font-family: Arial;  
            margin: 0px;
            padding: 0px;  
            border: 0px;  
        }
        .titlelogo {
            color: #2181D5;
            font-weight: bold;
            padding: 10px;
            font-size: 20px;
        }

        `}</style>
    </div>
);

export default Index;
